// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

import {PrivacyPool} from './PrivacyPool.sol';

contract PoolFactory {
  address public immutable verifier;
  address[] public pools;

  event PoolCreated(address indexed pool, uint256 denomination);

  constructor(address verifier_) {
    verifier = verifier_;
  }

  function createPool(uint256 denomination) external returns (address) {
    PrivacyPool pool = new PrivacyPool(verifier, denomination);
    pools.push(address(pool));
    emit PoolCreated(address(pool), denomination);
    return address(pool);
  }

  function allPools() external view returns (address[] memory) {
    return pools;
  }
}

